import { AppBar, styled, Toolbar, Typography, Box, InputBase,  Badge} from '@mui/material';
import {SportsEsportsIcon ,MailIcon} from '@mui/icons-material/SportsEsports';
import React from 'react';
import theme from './../theme';

const Styledtoolbar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
})
const Search = styled("div")(({theme})=>({
    backgroundColor: "white",
    padding: "0px 10px",
    borderRadius: theme.shape.borderRadius,
    width: "40%"
}))
const Icon = styled(Box)(({theme})=>({
    backgroundColor: "white",
}))
const Navbar = ()=>{
    return (
        <AppBar  position="sticky">
            <Styledtoolbar>
            <Typography variant="h5"  sx={{display:{xs: "none", sm: "block"}}}>Rgram</Typography>
            <SportsEsportsIcon  sx={{fontSize: "large", display:{xs: "block", sm: "none"}}}/>
            <Search><InputBase placeholder='search...'/></Search>
            <Icon> <Badge badgeContent = {10} color="error">
                <Mail/>
                </Badge>
                
                </Icon>
            </Styledtoolbar>
            
        </AppBar>

    )
}
export default Navbar;
